	return (
		<div className={classes.Meal}>
			<div >
				<img src="/img/1.png" alt="" />
			</div>
			<div>
				<h2>奇异果</h2>
				<p>维c丰富</p>
				<div>
					<span>价格</span>
					<div>数量</div>
				</div>
			</div>
		</div>
	);
};

export default Meal;
